import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Acceuil.css';
import logo from '../assets/logo.png'; // Importation de l'image du logo
import elephantBackground from '../assets/logo_vert.png'; // Importation du fond d'écran de l'éléphant
import { FaCamera } from 'react-icons/fa'; // Importation de l'icône de caméra depuis react-icons

function Acceuil() {
	const [image, setImage] = useState(null);
	const [loading, setLoading] = useState(false);
	const [progress, setProgress] = useState(0);
	const [loadingMessage, setLoadingMessage] = useState("Chargement de l'image...");
	const navigate = useNavigate();

	const handleImageUpload = (e) => {
		const file = e.target.files[0];
		if (file) {
			if (!file.type.startsWith("image/")) {
				alert('Veuillez télécharger uniquement une image.');
				return;
			}

			setLoading(true);
			setProgress(0);
			setLoadingMessage("Chargement de l'image...");

			let progressInterval = 0;
			const interval = setInterval(() => {
				if (progressInterval < 100) {
					progressInterval += 2;
					setProgress(progressInterval);
				} else {
					clearInterval(interval);
				}
			}, 100);

			const reader = new FileReader();

			setTimeout(() => {
				reader.onloadstart = () => {
					setProgress(100);
				};

				reader.onloadend = () => {
					setImage(reader.result);
					setLoading(false);
				};

				reader.readAsDataURL(file);
			}, 5000);
		}
	};

	const handleLogout = () => {
		navigate("/connexion");
	};

	return (
		<div className="home-container">
			<header className="navbar">
				<div className="logo-container">
					<img src={logo} alt="Logo Wildlens" className="navbar-logo" />
					<span className="navbar-title">WILDLENS</span>
				</div>
				<div className="navbar-links">
					<Link to="/" className="lienPage">
						<button className="navbar-button" onClick={handleLogout}>Déconnexion</button>
					</Link>
					<Link to="/inscription">
						<button className="navbar-button">Inscription</button>
					</Link>
				</div>
			</header>

			<div className="main-content">
				<div className="left-block" style={{ backgroundImage: `url(${elephantBackground})` }}>
					{/* Section Importer votre image */}
					<div className="section">
						<h2>Importer votre image</h2>
						<div className="image-upload">
							<input type="file" accept="image/*" onChange={handleImageUpload} />
						</div>
					</div>

					{/* Section Scanner votre image */}
					<div className="section">
						<h2>Scanner votre image</h2>
						<div className="camera-upload">
							<label htmlFor="cameraInput" className="camera-button">
								<FaCamera size={50} />
							</label>
							<input
								id="cameraInput"
								type="file"
								accept="image/*"
								capture="environment"
								onChange={handleImageUpload}
								style={{ display: 'none' }}
							/>
						</div>
					</div>
				</div>

				<div className="right-block">
					{loading ? (
						<div className="loader">
							<div className="progress-bar" style={{ width: `${progress}%` }}></div>
							<p>{loadingMessage}</p>
						</div>
					) : (
						image && <img src={image} alt="Image téléchargée" />
					)}
				</div>
			</div>
		</div>
	);
}

export default Acceuil;
